import React from "react";
import ChatContatos from "./chatContatos";
import ChatMsg from "./chatMsg";
import "./chat.css";

class Chat extends React.Component{

    constructor(props){
        super(props)
    }

    render(){
        return(
            <div className="chat-container">
                <ChatContatos/>
                <ChatMsg/>
            </div>
        )
    }

};

export default Chat;
